#define STDOUT 0xd0580000

.globl printToLogVectorized
printToLogVectorized:
    # Prologue
    addi sp, sp, -16
    sw a0, 0(sp)       # save a0
    sw a1, 4(sp)       # save a1
    sw ra, 8(sp)       # save return address

    li t0, 0           # t0 = i

print_loop:
    bge t0, a1, end_print  # if i >= length, break

    slli t2, t0, 2     # t2 = i * 4 (word offset)
    add t3, a0, t2     # t3 = address of a0[i]
    flw fa0, 0(t3)     # load float a0[i] into fa0

    la a0, float_format
    call printf        # printf("%f\n", a0[i])

    addi t0, t0, 1     # i++
    j print_loop

end_print:
    # Epilogue
    lw a0, 0(sp)
    lw a1, 4(sp)
    lw ra, 8(sp)
    addi sp, sp, 16
    ret

